Beautiful, unique hand dyed habotai medium weight silk yardage. Great for use as fabric, a table cloth, wall hanging, dress making, scarves, bags, tops, skirts. The possibilities are endless just like the beauty of the things you will make with this one of a kind fabric.


Shibori Hand Dyed, 75” H x 45” L,  8mm Silk Habotai also known as &quot;china silk&quot;




As seen in &quot;Prismatic Saturation: Textile works by Emily Beresford&quot; on view November 13-23, 2015 in the Circulation Gallery of E. H. Butler Library in Buffalo, NY.

This listing is for ONE One-of-a-kind Hand-carved pipe with acrylic stem, made by John Williams.

Pipes are carved from the outer edge of a Briar burl for maximum inclusion of beautiful natural variations in wood grain. John uses a traditional hand-carving process without a lathe.

This rustic piece features beautiful Bird&#39;s Eyes and Streaking patterns within the grain, with natural burl texture around the slanted rim of the bowl and stem.
Pipe has been stained and polished by hand using a unique finishing process for excellent lustre of the finished piece.

STEM:
The pipe includes a 3.75&quot; long Smoke Grey straight acrylic stem. Color cannot be substituted.
Pipe stem can be curved at customer request for no additional charge.

PIPE MEASUREMENTS:
•	Length from bowl to stem: 13.5&quot;
•	Bowl Width: 2&quot;
•	Stem Width: 1.5&quot;
•	Height of Bowl: 2.5&quot;
Message shopkeep for additional details.

